import React from 'react';
import {
  // Card,
  CardActions,
  CardContent,
  Typography,
  Box,
} from '@material-ui/core';
import { withTheme } from '@material-ui/core/styles';
import { blue } from '@material-ui/core/colors';
import Head from 'next/head';
import {
  Button,
  Background,
  Card,
  CardTitle,
  CardFooter,
  Pagination,
} from './styles';

const Quiz = () => {
  return (
    <>
      <Head>
        <link rel="stylesheet" href="/pages/quiz/styles.css" />
      </Head>
      <Background>
        <Card className="card">
          <CardContent>
            <CardTitle gutterBottom>
              Que tipo de empreendedor é você durante a crise?
            </CardTitle>
            <hr />
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardContent>
          <CardActions>
            <p id="question"></p>
            <form id="answers" action="#"></form>
          </CardActions>
          <CardFooter>
            <hr />
            <Button variant="contained" color="blue" className={['button']}>
              Próxima Pergunta
            </Button>
            <Pagination color="primary" style={{ marginTop: 40 }} count={10} />
          </CardFooter>
        </Card>
      </Background>
    </>
  );
};

export default withTheme(Quiz);
